const Stories = () => {

  const isLoading = true;

  let API = "http://hn.algolia.com/api/v1/search?query=html";

const fetchApiData = async (url) => {
    try {
    const res = await fetch(url);
    const data = await res.json();
    console.log(data);
    } catch (error) {
        console.log(error);
    }
};

useEffect(() => {
  fetchApiData(API);
}, []);

if (isLoading) {
  return(
    <>
      <h1></h1>
    </>
  );
}

  return (
    <>
      <h2>My Tech News Website</h2>
    </>
  );
};

export default Stories
